import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply Price Range Filter
    await page.waitForSelector('#searchInput');
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');
    await page.waitForSelector('.products-grid');

    // Set price range
    await page.fill('.price-input#minPrice', '100');
    await page.fill('.price-input#maxPrice', '500');
    await page.click('.apply-filter');

    // Wait for products to load after applying filter
    await page.waitForSelector('.products-grid .product-card');

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_filter.png'));

    // Extract product titles and prices for verification
    const products = await page.$$eval('.product-card', cards => {
      return cards.map(card => ({
        title: card.querySelector('.product-title').innerText,
        price: card.querySelector('.product-price').innerText
      }));
    });

    return {
      success: true,
      action: "Applied price range filter and extracted product data",
      extractedData: { products },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
